import React from 'react';

class TwitterCategoriesCard extends React.Component {
    render() {
        return (
            <div>
                <ul className="list-group">

                    <li className="list-group-item">
                        Notifications
                    </li>
                    <li className="list-group-item">
                        Messages
                    </li>
                </ul>
            </div>
        );
    }
}

export default TwitterCategoriesCard;
